// Input: the JSON you shared (usually from previous HTTP Request node)
const input = $json;

// Parse the `argument` field (which is a JSON string)
const arg = JSON.parse(input.argument);

// Extract values
const result = {
  id: input.id,
  sessionCookie: arg.sessionCookie,
  userAgent: arg.userAgent
};

// Return the structured result
return [{ json: result }];

/**
 * Report on Search Results
 * - 1 output item per unique "Employee Full Name" from the Merge node
 * - matchCount = number of hits returned by "Search records1"
 * - If matches: use first Search record's fields + matchCount
 * - If no matches: use original Merge fields + matchCount = 0
 */

const norm = (s) => String(s || "").trim().replace(/\s+/g, " ").toLowerCase();

// --- Grab MERGE items by node name (robust even if not wired directly) ---
const CANDIDATE_MERGE_NODE_NAMES = ["Merge", "Merge1", "Merge node", "Check status of Connection Request"];
let mergeItems = [];
for (const name of CANDIDATE_MERGE_NODE_NAMES) {
  try {
    const arr = $items(name) || [];
    if (arr.length) { mergeItems = arr; break; }
  } catch (_) {}
}

// If still nothing, last resort: try to infer from current inputs
if (mergeItems.length === 0) {
  try {
    const maybe = $input.all().map(i => i.json || {});
    mergeItems = maybe
      .filter(j => ("fullName" in j) && !("id" in j))
      .map(j => ({ json: j }));
  } catch (_) {}
}

// --- Grab SEARCH items from "Search records1" by node name ---
let searchItems = [];
try {
  searchItems = ($items("Search records2") || []);
} catch (_) {}

// Fallback: if not accessible by name, try current input stream
if (searchItems.length === 0) {
  try {
    const maybe = $input.all().map(i => i.json || {});
    const looksLikeSearch = (j) => ("id" in j) || ("fullName" in j);
    searchItems = maybe.filter(looksLikeSearch).map(j => ({ json: j }));
  } catch (_) {}
}

// --- Build unique queries (from Merge) ---
const queriesByNormName = new Map(); // normName -> original merge json
for (const it of mergeItems) {
  const j = it.json || {};
  const n = norm(j["fullName"]);
  if (!n) continue;
  if (!queriesByNormName.has(n)) queriesByNormName.set(n, j);
}

// If we still have zero queries, return empty to avoid misleading results
if (queriesByNormName.size === 0) {
  // But ensure node returns *something* only if search data exists
  const outs = [];
  const seen = new Set();
  for (const it of searchItems) {
    const r = it.json || {};
    const raw = r.Employee_Full_Name ?? r["Employee Full Name"] ?? r.fullName ?? r.name ?? "";
    const n = norm(raw);
    if (!n || seen.has(n)) continue;
    seen.add(n);
    outs.push({ json: { ...r, matchCount: 1 } });
  }
  return outs;
}

// --- Count matches by norm name (from Search) ---
const matchCountByName = new Map();
const firstResultByName = new Map();

for (const it of searchItems) {
  const r = it.json || {};
  const rawName =
    r.Employee_Full_Name ??
    r["Employee Full Name"] ??
    r.fullName ??
    r.name ??
    "";
  const n = norm(rawName);
  if (!n) continue;
  matchCountByName.set(n, (matchCountByName.get(n) || 0) + 1);
  if (!firstResultByName.has(n)) firstResultByName.set(n, r);
}

// --- Build outputs: ALWAYS one per unique query from Merge ---
const outputs = [];
for (const [nName, qJson] of queriesByNormName.entries()) {
  const count = matchCountByName.get(nName) || 0;
  const first = firstResultByName.get(nName);

  if (count > 0 && first) {
    outputs.push({
      json: {
        ...first,
        // align convenient name fields
        Employee_Full_Name: (first.Employee_Full_Name ?? qJson["Employee Full Name"] ?? "").trim(),
        "Employee Full Name": (qJson["Employee Full Name"] ?? first.Employee_Full_Name ?? "").trim(),
        // preserve original input URL for traceability
        Employee_LinkedIn_URL_from_input: qJson["Employee LinkedIn URL_from_input"],
        matchCount: count,
      },
    });
  } else {
    // 0 matches: include the person with matchCount = 0 (e.g., Hugh Jackman)
    outputs.push({
      json: {
        ...qJson,
        Employee_Full_Name: (qJson["Employee Full Name"] || "").trim(),
        matchCount: 0,
      },
    });
  }
}

return outputs;

